import EmployeesAddForm from '../employees-add-form/employees-add-form';

function App() {
    return <div className="app">
        <AppInfo/>
        <div className="search-panel">
            <SearchPanel/>
            <AppFilter/>
        </div>
        <EmployeesList/>
        <EmployeesAddForm/>
    </div>
}

export default App
